import React , {Component} from 'react';
import Slider from './slider/slider';
import SimpleImageSlider from 'react-simple-image-slider';


const images = [
    { url: "../../../images/@Wallpaper11261.jpg" },
    { url: '../../../images/@Wallpaper11295.jpg' },
    { url: '../../../images/@Wallpaper11394.jpg' },
  ];
const Home = () => {
    return ( 
        <>
            <Slider/>
            <SimpleImageSlider
        width={896}
        height={504}
        images={images}
        showBullets={true}
        showNavs={true}
      />

        </>
     );
}
 
export default Home;
